[[package]]
name = "anyio"
version = "3.5.0"
requires_python = ">=3.6.2"
summary = "High level compatibility layer for multiple asynchronous event loop implementations"
dependencies = [
    "idna>=2.8",
    "sniffio>=1.1",
]

[[package]]
name = "asgiref"
version = "3.5.0"
requires_python = ">=3.7"
summary = "ASGI specs, helper code, and adapters"

[[package]]
name = "click"
version = "8.1.2"
requires_python = ">=3.7"
summary = "Composable command line interface toolkit"
dependencies = [
    "colorama; platform_system == \"Windows\"",
]

[[package]]
name = "colorama"
version = "0.4.4"
requires_python = ">=2.7, !=3.0.*, !=3.1.*, !=3.2.*, !=3.3.*, !=3.4.*"
summary = "Cross-platform colored terminal text."

[[package]]
name = "fastapi"
version = "0.75.2"
requires_python = ">=3.6.1"
summary = "FastAPI framework, high performance, easy to learn, fast to code, ready for production"
dependencies = [
    "pydantic!=1.7,!=1.7.1,!=1.7.2,!=1.7.3,!=1.8,!=1.8.1,<2.0.0,>=1.6.2",
    "starlette==0.17.1",
]

[[package]]
name = "h11"
version = "0.13.0"
requires_python = ">=3.6"
summary = "A pure-Python, bring-your-own-I/O implementation of HTTP/1.1"

[[package]]
name = "idna"
version = "3.3"
requires_python = ">=3.5"
summary = "Internationalized Domain Names in Applications (IDNA)"

[[package]]
name = "numpy"
version = "1.22.3"
requires_python = ">=3.8"
summary = "NumPy is the fundamental package for array computing with Python."

[[package]]
name = "pulp"
version = "2.6.0"
summary = "PuLP is an LP modeler written in python. PuLP can generate MPS or LP files and call GLPK, COIN CLP/CBC, CPLEX, and GUROBI to solve linear problems."

[[package]]
name = "pydantic"
version = "1.9.0"
requires_python = ">=3.6.1"
summary = "Data validation and settings management using python 3.6 type hinting"
dependencies = [
    "typing-extensions>=3.7.4.3",
]

[[package]]
name = "scipy"
version = "1.8.0"
requires_python = ">=3.8,<3.11"
summary = "SciPy: Scientific Library for Python"
dependencies = [
    "numpy<1.25.0,>=1.17.3",
]

[[package]]
name = "sniffio"
version = "1.2.0"
requires_python = ">=3.5"
summary = "Sniff out which async library your code is running under"

[[package]]
name = "starlette"
version = "0.17.1"
requires_python = ">=3.6"
summary = "The little ASGI library that shines."
dependencies = [
    "anyio<4,>=3.0.0",
]

[[package]]
name = "typing-extensions"
version = "4.2.0"
requires_python = ">=3.7"
summary = "Backported and Experimental Type Hints for Python 3.7+"

[[package]]
name = "uvicorn"
version = "0.17.6"
requires_python = ">=3.7"
summary = "The lightning-fast ASGI server."
dependencies = [
    "asgiref>=3.4.0",
    "click>=7.0",
    "h11>=0.8",
]

